13.w2steam.com/wp-content/uploads/2019/08/cropped-bds-logo.png',0,'attachment','image/png',0),(426,1,'2019-08-03 13:49:45','2019-08-03 06:49:45','<!-- wp:html -->\n[ux_slider label=\"Slider\" nav_size=\"normal\" nav_style=\"simple\" bullet_style=\"dashes\" timer=\"4000\"]\n\n[ux_image id=\"227\" image_size=\"original\" height=\"33%\"]\n\n[ux_image id=\"231\" image_size=\"original\" height=\"33%\"]\n\n\n[/ux_slider]\n[section label=\"Giới thiệu\" padding=\"43px\" class=\"gioi-thieu-section\"]\n\n[row]\n\n[col span__sm=\"12\"]\n\n[title style=\"center\" text=\"Giới thiệu dự án An Hạ\" tag_name=\"h2\" color=\"rgb(209, 0, 0)\"]\n\n<p id=\"gioi-thieu\" style=\"text-align: center;\">Dự án An Hạ Garden mang đến hàng trăm cơ hội an cư sở hữu đất nền giá trẻ, cũng như giải pháp sinh lời cao cho các nhà đầu tư biết nắm bắt cơ hội, đồng thời hứa hẹn đem đến không gian lý tưởng, một khoảng trời xanh nằm ở phía Tây Sài Gòn.</p>\n\n[/col]\n[col span=\"4\" span__sm=\"12\"]\n\n[ux_image id=\"248\" image_size=\"original\" height=\"60%\"]\n\n\n[/col]\n[col span=\"4\" span__sm=\"12\"]\n\n[ux_image id=\"247\" image_size=\"original\" height=\"60%\"]\n\n\n[/col]\n[col span=\"4\" span__sm=\"12\"]\n\n[ux_image id=\"249\" image_size=\"original\" height=\"60%\"]\n\n\n[/col]\n[col span__sm=\"12\"]\n\n[gap]\n\n[ux_image id=\"260\" image_size=\"original\"]\n\n<p style=\"text-align: left;\">Sở hữu vị trí đắc địa nằm ngay trung tâm xã Bình Lợi, là khu dân cư mới đầu tiên được quy hoạch đồng bộ theo Chủ trương của Thành phố, thừa hưởng cơ sở hạ tầng phát triển đồng bộ, giao thông di chuyển thuận lợi. Khu dân cư An Hạ Garden kiến tạo vùng đất mới, nơi khởi sinh một tổ ấm viên mãn, nơi những giá trị sống được lưu giữ và trân quý.</p>\n\n[/col]\n\n[/row]\n\n[/section]\n[section label=\"Vị trí\" bg=\"62\" bg_size=\"original\" bg_overlay=\"rgba(255, 255, 255, 0.82)\" padding=\"44px\" class=\"vi-tri-section\"]\n\n[row]\n\n[col span__sm=\"12\"]\n\n[title style=\"center\" text=\"Vị trí đắc địa\" tag_name=\"h2\" color=\"rgb(200, 0, 0)\"]\n\n<p id=\"vi-tri\" style=\"text-align: center;\">Nằm ở vị trí trung tâm xã Bình Lợi, là khu dân cư mới đầu tiên được quy hoạch đồng bộ theo Chủ trương của Thành phố. Dự án nằm trên đường Kênh số 10, xã Bình Lợi, Huyện Bình Chánh, TP. Hồ Chí Minh. Đây là 1 vị trí sinh sống và đầu tư lý tưởng sẽ làm hài lòng tất cả mọi quý khách hàng khó tính nhất.</p>\n[ux_image id=\"272\" image_size=\"original\"]\n\n\n[/col]\n\n[/row]\n\n[/section]\n[section label=\"Tiện ích\" bg_color=\"rgb(255, 255, 255)\" padding=\"37px\" class=\"tien-ich-section\"]\n\n[row style=\"small\"]\n\n[col span__sm=\"12\"]\n\n[title style=\"center\" text=\"Tiện ích an hạ gargen\" tag_name=\"h2\" color=\"rgb(184, 0, 0)\"]\n\n<div class=\"box-header\" id=\"tien-ich\">\n<p style=\"text-align: center;\"><span style=\"color: #555555; font-size: 100%;\">AN HẠ GARDEN có hệ thống dịch vụ tiện ích tiềm năng, sẵn sàng đáp ứng mọi nhu cầu sinh hoạt, vui chơi, giải trí, giúp cư dân nơi đây thật sự được hưởng thụ cuộc sống, cũng như thể hiện rõ điểm sáng nổi bật trong hệ thống đất nền tiềm năng cho các nhà Đầu tư.</span></p>\n</div>\n\n[/col]\n[col span=\"3\" span__sm=\"12\"]\n\n[ux_image id=\"54\" image_size=\"original\" height=\"63%\"]\n\n\n[/col]\n[col span=\"3\" span__sm=\"12\"]\n\n[ux_image id=\"56\" image_size=\"original\" height=\"63%\"]\n\n\n[/col]\n[col span=\"3\" span__sm=\"12\"]\n\n[ux_image id=\"58\" image_size=\"original\" height=\"63%\"]\n\n\n[/col]\n[col span=\"3\" span__sm=\"12\"]\n\n[ux_image id=\"59\" image_size=\"original\" height=\"63%\"]\n\n\n[/col]\n[col span=\"6\" span__sm=\"12\"]\n\n<div class=\"box-header\">\n<h3><span style=\"color: #bd0000;\">CUỘC SỐNG TIỆN NGHI - TƯƠNG LAI BỀN VỮNG</span></h3>\n<div class=\"box-content text-justify\">\n<p>Điểm mấu chốt và đặc biệt quan trọng khi mua một sản phẩm bất động sản là việc sở hữu vị trí đắt giá, giao thông thuận tiện, hạ tầng cơ sở tiêu chuẩn, tận hưởng các tiện ích nổi trội. Nhằm đáp ứng mong muốn của cư dân về cộng đồng dân trí cao, môi trường sống lành mạnh, hệ thống giáo dục toàn diện cho sự phát triển của con cái trong tương lai, chúng tôi sẽ mang đến cho bạn giải pháp tối ưu.</p>\n<p>Đó chính là An Hạ Garden - dự án căn hộ chung cư đầu tiên tại Quảng Ninh có mức giá siêu hấp dẫn với lợi thế “6 trong 1”.</p>\n</div>\n</div>\n\n[/col]\n[col span=\"3\" span__sm=\"12\"]\n\n[gap]\n\n[ux_image id=\"61\" image_size=\"original\" height=\"65%\"]\n\n\n[/col]\n[col span=\"3\" span__sm=\"12\"]\n\n[gap]\n\n[ux_image id=\"62\" image_size=\"original\" height=\"65%\"]\n\n\n[/col]\n[col span=\"6\" span__sm=\"12\"]\n\n[ux_image id=\"414\" image_size=\"original\" height=\"64%\"]\n\n\n[/col]\n[col span=\"6\" span__sm=\"12\"]\n\n<h3><span style=\"color: #bd0000;\">ĐĂNG KÝ NHẬN TƯ VẤN MIỄN PHÍ</span></h3>\n<p>Vui lòng gửi thông tin cá nhân để nhận tư vấn miễn phí từ chuyên viên BĐS:</p>\n[contact-form-7 id=\"67\"]\n\n\n[/col]\n\n[/row]\n\n[/section]\n[section label=\"Đặc điểm\" bg_color=\"rgb(242, 242, 242)\" padding=\"35px\"]\n\n[row style=\"small\"]\n\n[col span=\"6\" span__sm=\"12\"]\n\n[featured_box img=\"79\" img_width=\"135\" pos=\"left\"]\n\n<h3><span style=\"color: #bd0000; font-size: 110%;\">Mức giá hấp dẫn</span></h3>\n<p><span style=\"font-size: 90%;\">- Sở hữu căn hộ cao cấp với mức giá lý tưởng<br />- Thiết kế dựa trên nhu cầu nâng cao chất lượng sống của dân cư có thu nhập tầm trung.<br />- Một trong số ít các chung cư có giá cả vừa phải nhưng đi kèm với môi trường sống toàn vẹn.</span></p>\n\n[/featured_box]\n[gap height=\"23px\"]\n\n[featured_box img=\"86\" img_width=\"135\" pos=\"left\"]\n\n<h3><span style=\"color: #bd0000; font-size: 110%;\">Thiết kế xứng tầm</span></h3>\n<p><span style=\"font-size: 90%;\">- Sở hữu căn hộ cao cấp với mức giá lý tưởng<br />- Thiết kế dựa trên nhu cầu nâng cao chất lượng sống của dân cư có thu nhập tầm trung.</span></p>\n\n[/featured_box]\n\n[/col]\n[col span=\"6\" span__sm=\"12\"]\n\n[featured_box img=\"94\" img_width=\"135\" pos=\"left\"]\n\n<h3><span style=\"color: #bd0000; font-size: 110%;\">Mức giá hấp dẫn</span></h3>\n<p><span style=\"font-size: 90%;\">- Sở hữu căn hộ cao cấp với mức giá lý tưởng<br />- Thiết kế dựa trên nhu cầu nâng cao chất lượng sống của dân cư có thu nhập tầm trung.<br />- Một trong số ít các chung cư có giá cả vừa phải nhưng đi kèm với môi trường sống toàn vẹn.</span></p>\n\n[/featured_box]\n[gap height=\"23px\"]\n\n[featured_box img=\"90\" img_width=\"135\" pos=\"left\"]\n\n<h3><span style=\"color: #bd0000;\">Vị trí đắc địa</span></h3>\n<p><span style=\"font-size: 90%;\">- Toạ lạc tại vị trí trung tâm khu Đa giác 4 với góc nhìn mở hướng ra vịnh Hạ Long<br />- Giao thông thuận lợi<br />- Phong thuỷ hài hoà, mặt hướng biển lưng tựa núi</span></p>\n\n[/featured_box]\n\n[/col]\n\n[/row]\n\n[/section]\n[section label=\"Mặt bằng\" padding=\"36px\" class=\"mat-bang-section\"]\n\n[row]\n\n[col span__sm=\"12\"]\n\n[title style=\"center\" text=\"Mặt bằng An Hạ Gargen\" tag_name=\"h2\" color=\"rgb(184, 0, 0)\"]\n\n\n[/col]\n[col span=\"5\" span__sm=\"12\" class=\"danh_sach_can_ho\"]\n\n<p id=\"mat-bang\"><span style=\"font-size: 120%;\"><span style=\"color: #bd0000;\">AN HẠ GARDEN</span> toạ lạc tại khu Tây Sài Gòn được tung ra thị trường vào tháng 8/2019.</span></p>\n<p><span style=\"font-size: 120%;\">Dự án có quy mô 1ha tọa lạc tại vị trí vô cùng đắc địa ngay trung tâm phát triển năng động nhất Bình Chánh trong nhiều năm trở lại đây.</span></p>\n[button text=\"Xem phương thức thanh toán\" letter_case=\"lowercase\" radius=\"99\" icon=\"icon-angle-right\" link=\"#thanh_toan\" class=\"nut-xem-chi-tiet\"]\n\n\n[/col]\n[col span=\"7\" span__sm=\"12\"]\n\n[ux_slider nav_size=\"normal\" nav_style=\"simple\" bullets=\"false\"]\n\n[ux_image id=\"309\" image_size=\"original\"]\n\n[ux_image id=\"311\" image_size=\"original\"]\n\n\n[/ux_slider]\n\n[/col]\n\n[/row]\n\n[/section]\n[section label=\"Phương thức thanh toán\" bg_color=\"rgb(242, 242, 242)\" padding=\"38px\" class=\"thanh-toan-section\"]\n\n[row style=\"large\" width=\"custom\" custom_width=\"980px\"]\n\n[col span__sm=\"12\"]\n\n[title style=\"center\" text=\"Phương thức thanh toán An Hạ Garden\" tag_name=\"h2\" color=\"rgb(195, 0, 0)\"]\n\n<p><strong>CHIẾT KHẤU MẠNH 5% + TẶNG 5 CHỈ VÀNG SJC+ SỔ TIẾT KIỆM 20 TRIỆU </strong></p>\n<p><strong>I. PHƯƠNG THỨC THANH TOÁN 35%</strong></p>\n<p>An Hạ Garden với mức giá bán hợp lý chỉ từ<strong> 14 triệu/ m2.</strong></p>\n<p><strong>- </strong>Đặc biệt những Khách hàng mua trong đợt này sẽ được tặng<strong> 5 chỉ vàng SJC + Chiết khấu 5% + Sổ Tiết Kiệm 20 triệu</strong><br />- Phương thức thanh toán ưu việt theo tiến độ. Khách hàng chỉ cần trả trước 490 triệu đồng là sở hữu ngay một nền đất. Số tiền còn lại được Ngân hàng hỗ trợ cho vay từ 50% nên không chỉ giảm áp lực tài chính, mà còn giúp khách hàng sử dụng vốn đầu tư hiệu quả.</p>\n<p>- Trong bối cảnh hiện nay, việc đầu tư vào những dự án bất động sản An Hạ Garden không chỉ an toàn mà còn nhanh chóng mang lại lợi nhuận, nhất là khi Quốc hội vừa đưa ra chủ trương thúc đẩy nhanh tiến độ xây dựng tuyến đường Vành đai 3.</p>\n<table border=\"1\" cellspacing=\"1\" cellpadding=\"1\">\n<tbody>\n<tr>\n<td>ĐỢT TT</td>\n<td>THỜI ĐIỂM THANH TOÁN</td>\n<td>PTTT 35%</td>\n</tr>\n<tr>\n<td> </td>\n<td>Ngay khi ký phiếu cọc</td>\n<td>100.000.000 đồng</td>\n</tr>\n<tr>\n<td>ĐỢT 1</td>\n<td>\n<p>Ký HĐNT (Trong vòng 7 ngày kể từ ngày ký phiếu cọc)</p>\n</td>\n<td>35% giá trị sản phẩm (bao gồm tiền đặt cọc)</td>\n</tr>\n<tr>\n<td>ĐỢT 2</td>\n<td>\n<p>Trong vòng 45 ngày kể từ ngày thanh toán đợt 1</p>\n</td>\n<td>20% giá trị sản phẩm</td>\n</tr>\n<tr>\n<td>ĐỢT 3</td>\n<td>\n<p>Trong vòng 105 ngày kể từ ngày thanh toán đợt 1</p>\n</td>\n<td>15% giá trị sản phẩm</td>\n</tr>\n<tr>\n<td>ĐỢT 4</td>\n<td>Trong vòng 165 ngày kể từ ngày thanh toán đợt 1</td>\n<td>15% giá trị sản phẩm</td>\n</tr>\n<tr>\n<td>ĐỢT 5</td>\n<td>Trong vòng 225 ngày kể từ ngày thanh toán đợt 1</td>\n<td>10% giá trị sản phẩm</td>\n</tr>\n<tr>\n<td>ĐỢT 6</td>\n<td>Ngay sau khi bàn giao Giấy Chứng Nhận Quyền Sử Dụng Đất</td>\n<td>5% giá trị sản phẩm</td>\n</tr>\n</tbody>\n</table>\n<p>Đặc biệt những Khách hàng mua trong đợt này sẽ được tặng<strong> 5 chỉ vàng SJC + Chiết khấu 5%+ 1 Sổ Tiết Kiệm 20 triệu</strong></p>\n\n[/col]\n\n[/row]\n\n[/section]\n[section label=\"Tiến độ\" padding=\"37px\" class=\"tien-do\"]\n\n[row]\n\n[col span__sm=\"12\"]\n\n[title style=\"center\" text=\"Tiến độ dự án An Hạ Gargen\" tag_name=\"h2\" color=\"rgb(170, 0, 0)\"]\n\n\n[/col]\n[col span=\"6\" span__sm=\"12\"]\n\n<ul id=\"tien-do\">\n<li class=\"bullet-checkmark bullet-star\"><strong><span style=\"color: #bd0000;\">1. </span></strong>Dự án AN HẠ GARDEN quy mô 1 ha,vị trí đắc địa khu vực phía Tây Sài Gòn “Trái tim của các nhà đầu tư”. </li>\n<li class=\"bullet-checkmark bullet-star\"><span style=\"color: #bd0000;\"><strong>2.</strong> </span>Đây là dự án đất nền tại Bình Chánh, TP HCM nhưng giá bán cực kỳ ưu đãi chỉ 14triệu/m2, đây là mức giá rất hiếm trên thị trường</li>\n<li class=\"bullet-checkmark bullet-star\"><span style=\"color: #bd0000;\"><strong>3.</strong></span> Dự án AN HẠ GARDEN được thiết kế rất hiện đại nhưng cũng gần gũi với thiên nhiên, 2 mặt giáp sông cực kì thoáng mát. Rất thích hợp cho hộ gia đình về an cư, nghỉ dưỡng.</li>\n<li class=\"bullet-checkmark bullet-star\"><span style=\"color: #bd0000;\"><strong>4. </strong></span>Liền kề các cụm khu công nghiệp lớn như KCN AN HẠ, KCN LÊ MINH XUÂN, KCN TÂN ĐÔ, TÂN ĐỨC.....Đường tỉnh lộ 10 kết nối giao thông giao thương giữa các tỉnh thành miền tây một cách nhanh chóng.</li>\n<li class=\"bullet-checkmark bullet-star\"><strong><span style=\"color: #bd0000;\">5.</span> </strong>Bệnh viện Chợ Rẫy 2 và bệnh viện Nhi Đồng 3 đã được khởi công xây dựng. Bộ y tế quyết định đưa 2 bệnh viện lớn về phía khu vực giãn dân để giảm tải cho các khu vực trung tâm thành phố cũng như là phục vụ nhu cầu của người dân khu vực ngoại thành tốt hơn.</li>\n</ul>\n\n[/col]\n[col span=\"6\" span__sm=\"12\"]\n\n[ux_image id=\"260\" image_size=\"original\"]\n\n\n[/col]\n\n[/row]\n\n[/section]\n[section label=\"Hình ảnh\" bg_color=\"rgb(246, 246, 246)\" padding=\"42px\" class=\"tin-tuc-section\"]\n\n[row style=\"small\"]\n\n[col span__sm=\"12\"]\n\n[title style=\"center\" text=\"Hình ảnh dự án\" tag_name=\"h2\" color=\"rgb(211, 0, 0)\"]\n\n<p id=\"hinh-anh\" style=\"text-align: center;\">Mời bạn cùng xem một số hình ảnh về dự án cũng như tiến độ thực hiện dự án trong thời gian tới</p>\n[ux_gallery ids=\"344,345,346,347,348,349,350,309,248\" style=\"normal\" col_spacing=\"xsmall\" columns=\"3\" image_height=\"70%\" image_size=\"original\" image_overlay=\"rgba(255, 255, 255, 0.37)\" image_hover=\"overlay-add\" image_hover_alt=\"null\" text_align=\"center\" class=\"list-hinh-anh\"]\n\n\n[/col]\n\n[/row]\n\n[/section]\n[section label=\"Liên hệ\" bg_color=\"rgb(22, 22, 22)\" dark=\"true\" padding=\"39px\" class=\"lien-he-section\"]\n\n[row style=\"small\"]\n\n[col span=\"4\" span__sm=\"12\" align=\"center\"]\n\n[ux_image id=\"359\" image_size=\"original\" width=\"40\" link=\"http://bds13.w2steam.com\"]\n\n<p><strong><img src=\"http://datnengiarebinhchanh.com/upload/images/M%C5%A9i%20t%C3%AAn%20Gif%20(19).gif\" alt=\"\" /> CÔNG TY BẤT ĐỘNG SẢN KK GROUP</strong></p>\n<ul>\n<li style=\"text-align: left;\"><span style=\"font-size: 90%; color: #c0c0c0;\">Địa chỉ: Gia Lập - Gia Viễn - Ninh Bình</span></li>\n<li style=\"text-align: left;\"><span style=\"font-size: 90%; color: #c0c0c0;\">Hotline: 0123.456.789</span></li>\n<li style=\"text-align: left;\"><span style=\"font-size: 90%; color: #c0c0c0;\">Email: info.giuseart.com@gmail.com</span></li>\n<li style=\"text-align: left;\"><span style=\"font-size: 90%; color: #c0c0c0;\">Website: <a style=\"color: #c0c0c0;\" href=\"http://giuseart.com\">www.giuseart.com</a></span></li>\n<li style=\"text-align: left;\"><span style=\"font-size: 90%; color: #c0c0c0;\">Facebook: <a href=\"https://www.facebook.com/truongtt0808\">https://www.facebook.com/joseph.thien.75</a></span></li>\n</ul>\n<p> </p>\n\n[/col]\n[col span=\"5\" span__sm=\"12\"]\n\n<h3 id=\"lien-he\"><span style=\"color: #ffffff;\">ĐĂNG KÝ NHẬN TƯ VẤN MIỄN PHÍ</span></h3>\n<p><span style=\"color: #c0c0c0; font-size: 95%;\">Vui lòng cung cấp thông tin để chuyên viên tư vấn của chúng tôi sẽ tư vấn trực tiếp cho bạn về dự án đang hot này:</span></p>\n[contact-form-7 id=\"67\"]\n\n\n[/col]\n[col span=\"3\" span__sm=\"12\"]\n\n[ux_image id=\"345\" image_size=\"original\"]\n\n<h3><span style=\"color: #ffffff; font-size: 100%;\">An Hạ Garden</span></h3>\n<p><span style=\"color: #c0c0c0; font-size: 90%;\">Dự án An Hạ Garden mang đến hàng trăm cơ hội an cư sở hữu đất nền giá trẻ, cũng như giải pháp sinh lời cao cho các nhà đầu tư biết nắm bắt cơ hội, đồng thời hứa hẹn đem đến không gian lý tưởng, một khoảng trời xanh nằm ở phía Tây Sài Gòn.</span></p>\n\n[/col]\n\n[/row]\n\n[/section]\n\n<!-- /wp:html -->','Trang chủ','','inherit','closed','closed','','2-revision-v1','','','2019-08-03 13:49:45','2019-08-03 06:49:45','',2,'http://bds13.w2steam.com/2-revision-v1/',0,'revision','',0),(427,1,'2019-08-03 13:50:48','2019-08-03 06:50:48','<!-- wp:html -->\n[ux_slider label=\"Slider\" nav_size=\"normal\" nav_style=\"simple\" bullet_style=\"dashes\" timer=\"4000\"]\n\n[ux_image id=\"227\" image_size=\"original\" height=\"33%\"]\n\n[ux_image id=\"231\" image_size=\"original\" height=\"33%\"]\n\n\n[/ux_slider]\n[section label=\"Giới thiệu\" padding=\"43px\" class=\"gioi-thieu-section\"]\n\n[row]\n\n[col span__sm=\"12\"]\n\n[title style=\"center\" text=\"Giới thiệu dự án An Hạ\" tag_name=\"h2\" color=\"rgb(209, 0, 0)\"]\n\n<p id=\"gioi-thieu\" style=\"text-align: center;\">Dự án An Hạ Garden mang đến hàng trăm cơ hội an cư sở hữu đất nền giá trẻ, cũng như giải pháp sinh lời cao cho các nhà đầu tư biết nắm bắt cơ hội, đồng thời hứa hẹn đem đến không gian lý tưởng, một khoảng trời xanh nằm ở phía Tây Sài Gòn.</p>\n\n[/col]\n[col span=\"4\" span__sm=\"12\"]\n\n[ux_image id=\"248\" image_size=\"original\" height=\"60%\"]\n\n\n[/col]\n[col span=\"4\" span__sm=\"12\"]\n\n[ux_image id=\"247\" image_size=\"original\" height=\"60%\"]\n\n\n[/col]\n[col span=\"4\" span__sm=\"12\"]\n\n[ux_image id=\"249\" image_size=\"original\" height=\"60%\"]\n\n\n[/col]\n[col span__sm=\"12\"]\n\n[gap]\n\n[ux_image id=\"260\" image_size=\"original\"]\n\n<p style=\"text-align: left;\">Sở hữu vị trí đắc địa nằm ngay trung tâm xã Bình Lợi, là khu dân cư mới đầu tiên được quy hoạch đồng bộ theo Chủ trương của Thành phố, thừa hưởng cơ sở hạ tầng phát triển đồng bộ, giao thông di chuyển thuận lợi. Khu dân cư An Hạ Garden kiến tạo vùng đất mới, nơi khởi sinh một tổ ấm viên mãn, nơi những giá trị sống được lưu giữ và trân quý.</p>\n\n[/col]\n\n[/row]\n\n[/section]\n[section label=\"Vị trí\" bg=\"62\" bg_size=\"original\" bg_overlay=\"rgba(255, 255, 255, 0.82)\" padding=\"44px\" class=\"vi-tri-section\"]\n\n[row]\n\n[col span__sm=\"12\"]\n\n[title style=\"center\" text=\"Vị trí đắc địa\" tag_name=\"h2\" color=\"rgb(200, 0, 0)\"]\n\n<p id=\"vi-tri\" style=\"text-align: center;\">Nằm ở vị trí trung tâm xã Bình Lợi, là khu dân cư mới đầu tiên được quy hoạch đồng bộ theo Chủ trương của Thành phố. Dự án nằm trên đường Kênh số 10, xã Bình Lợi, Huyện Bình Chánh, TP. Hồ Chí Minh. Đây là 1 vị trí sinh sống và đầu tư lý tưởng sẽ làm hài lòng tất cả mọi quý khách hàng khó tính nhất.</p>\n[ux_image id=\"272\" image_size=\"original\"]\n\n\n[/col]\n\n[/row]\n\n[/section]\n[section label=\"Tiện ích\" bg_color=\"rgb(255, 255, 255)\" padding=\"37px\" class=\"tien-ich-section\"]\n\n[row style=\"small\"]\n\n[col span__sm=\"12\"]\n\n[title style=\"center\" text=\"Tiện ích an hạ gargen\" tag_name=\"h2\" color=\"rgb(184, 0, 0)\"]\n\n<div class=\"box-header\" id=\"tien-ich\">\n<p style=\"text-align: center;\"><span style=\"color: #555555; font-size: 100%;\">AN HẠ GARDEN có hệ thống dịch vụ tiện ích tiềm năng, sẵn sàng đáp ứng mọi nhu cầu sinh hoạt, vui chơi, giải trí, giúp cư dân nơi đây thật sự được hưởng thụ cuộc sống, cũng như thể hiện rõ điểm sáng nổi bật trong hệ thống đất nền tiềm năng cho các nhà Đầu tư.</span></p>\n</div>\n\n[/col]\n[col span=\"3\" span__sm=\"12\"]\n\n[ux_image id=\"54\" image_size=\"original\" height=\"63%\"]\n\n\n[/col]\n[col span=\"3\" span__sm=\"12\"]\n\n[ux_image id=\"56\" image_size=\"original\" height=\"63%\"]\n\n\n[/col]\n[col span=\"3\" span__sm=\"12\"]\n\n[ux_image id=\"58\" image_size=\"original\" height=\"63%\"]\n\n\n[/col]\n[col span=\"3\" span__sm=\"12\"]\n\n[ux_image id=\"59\" image_size=\"original\" height=\"63%\"]\n\n\n[/col]\n[col span=\"6\" span__sm=\"12\"]\n\n<div class=\"box-header\">\n<h3><span style=\"color: #bd0000;\">CUỘC SỐNG TIỆN NGHI - TƯƠNG LAI BỀN VỮNG</span></h3>\n<div class=\"box-content text-justify\">\n<p>Điểm mấu chốt và đặc biệt quan trọng khi mua một sản phẩm bất động sản là việc sở hữu vị trí đắt giá, giao thông thuận tiện, hạ tầng cơ sở tiêu chuẩn, tận hưởng các tiện ích nổi trội. Nhằm đáp ứng mong muốn của cư dân về cộng đồng dân trí cao, môi trường sống lành mạnh, hệ thống giáo dục toàn diện cho sự phát triển của con cái trong tương lai, chúng tôi sẽ mang đến cho bạn giải pháp tối ưu.</p>\n<p>Đó chính là An Hạ Garden - dự án căn hộ chung cư đầu tiên tại Quảng Ninh có mức giá siêu hấp dẫn với lợi thế “6 trong 1”.</p>\n</div>\n</div>\n\n[/col]\n[col span=\"3\" span__sm=\"12\"]\n\n[gap]\n\n[ux_image id=\"61\" image_size=\"original\" height=\"65%\"]\n\n\n[/col]\n[col span=\"3\" span__sm=\"12\"]\n\n[gap]\n\n[ux_image id=\"62\" image_size=\"original\" height=\"65%\"]\n\n\n[/col]\n[col span=\"6\" span__sm=\"12\"]\n\n[ux_image id=\"414\" image_size=\"original\" height=\"64%\"]\n\n\n[/col]\n[col span=\"6\" span__sm=\"12\"]\n\n<h3><span style=\"color: #bd0000;\">ĐĂNG KÝ NHẬN TƯ VẤN MIỄN PHÍ</span></h3>\n<p>Vui lòng gửi thông tin cá nhân để nhận tư vấn miễn phí từ chuyên viên BĐS:</p>\n[contact-form-7 id=\"67\"]\n\n\n[/col]\n\n[/row]\n\n[/section]\n[section label=\"Đặc điểm\" bg_color=\"rgb(242, 242, 242)\" padding=\"35px\"]\n\n[row style=\"small\"]\n\n[col span=\"6\" span__sm=\"12\"]\n\n[featured_box img=\"79\" img_width=\"135\" pos=\"left\"]\n\n<h3><span style=\"color: #bd0000; font-size: 110%;\">Mức giá hấp dẫn</span></h3>\n<p><span style=\"font-size: 90%;\">- Sở hữu căn hộ cao cấp với mức giá lý tưởng<br />- Thiết kế dựa trên nhu cầu nâng cao chất lượng sống của dân cư có thu nhập tầm trung.<br />- Một trong số ít các chung cư có giá cả vừa phải nhưng đi kèm với môi trường sống toàn vẹn.</span></p>\n\n[/featured_box]\n[gap height=\"23px\"]\n\n[featured_box img=\"86\" img_width=\"135\" pos=\"left\"]\n\n<h3><span style=\"color: #bd0000; font-size: 110%;\">Thiết kế xứng tầm</span></h3>\n<p><span style=\"font-size: 90%;\">- Sở hữu căn hộ cao cấp với mức giá lý tưởng<br />- Thiết kế dựa trên nhu cầu nâng cao chất lượng sống của dân cư có thu nhập tầm trung.</span></p>\n\n[/featured_box]\n\n[/col]\n[col span=\"6\" span__sm=\"12\"]\n\n[featured_box img=\"94\" img_width=\"135\" pos=\"left\"]\n\n<h3><span style=\"color: #bd0000; font-size: 110%;\">Mức giá hấp dẫn</span></h3>\n<p><span style=\"font-size: 90%;\">- Sở hữu căn hộ cao cấp với mức giá lý tưởng<br />- Thiết kế dựa trên nhu cầu nâng cao chất lượng sống của dân cư có thu nhập tầm trung.<br />- Một trong số ít các chung cư có giá cả vừa phải nhưng đi kèm với môi trường sống toàn vẹn.</span></p>\n\n[/featured_box]\n[gap height=\"23px\"]\n\n[featured_box img=\"90\" img_width=\"135\" pos=\"left\"]\n\n<h3><span style=\"color: #bd0000;\">Vị trí đắc địa</span></h3>\n<p><span style=\"font-size: 90%;\">- Toạ lạc tại vị trí trung tâm khu Đa giác 4 với góc nhìn mở hướng ra vịnh Hạ Long<br />- Giao thông thuận lợi<br />- Phong thuỷ hài hoà, mặt hướng biển lưng tựa núi</span></p>\n\n[/featured_box]\n\n[/col]\n\n[/row]\n\n[/section]\n[section label=\"Mặt bằng\" padding=\"36px\" class=\"mat-bang-section\"]\n\n[row]\n\n[col span__sm=\"12\"]\n\n[title style=\"center\" text=\"Mặt bằng An Hạ Gargen\" tag_name=\"h2\" color=\"rgb(184, 0, 0)\"]\n\n\n[/col]\n[col span=\"5\" span__sm=\"12\" class=\"danh_sach_can_ho\"]\n\n<p id=\"mat-bang\"><span style=\"font-size: 120%;\"><span style=\"color: #bd0000;\">AN HẠ GARDEN</span> toạ lạc tại khu Tây Sài Gòn được tung ra thị trường vào tháng 8/2019.</span></p>\n<p><span style=\"font-size: 120%;\">Dự án có quy mô 1ha tọa lạc tại vị trí vô cùng đắc địa ngay trung tâm phát triển năng động nhất Bình Chánh trong nhiều năm trở lại đây.</span></p>\n[button text=\"Xem phương thức thanh toán\" letter_case=\"lowercase\" radius=\"99\" icon=\"icon-angle-right\" link=\"#thanh_toan\" class=\"nut-xem-chi-tiet\"]\n\n\n[/col]\n[col span=\"7\" span__sm=\"12\"]\n\n[ux_slider nav_size=\"normal\" nav_style=\"simple\" bullets=\"false\"]\n\n[ux_image id=\"309\" image_size=\"original\"]\n\n[ux_image id=\"311\" image_size=\"original\"]\n\n\n[/ux_slider]\n\n[/col]\n\n[/row]\n\n[/section]\n[section label=\"Phương thức thanh toán\" bg_color=\"rgb(242, 242, 242)\" padding=\"38px\" class=\"thanh-toan-section\"]\n\n[row style=\"large\" width=\"custom\" custom_width=\"980px\"]\n\n[col span__sm=\"12\"]\n\n[title style=\"center\" text=\"Phương thức thanh toán An Hạ Garden\" tag_name=\"h2\" color=\"rgb(195, 0, 0)\"]\n\n<p><strong>CHIẾT KHẤU MẠNH 5% + TẶNG 5 CHỈ VÀNG SJC+ SỔ TIẾT KIỆM 20 TRIỆU </strong></p>\n<p><strong>I. PHƯƠNG THỨC THANH TOÁN 35%</strong></p>\n<p>An Hạ Garden với mức giá bán hợp lý chỉ từ<strong> 14 triệu/ m2.</strong></p>\n<p><strong>- </strong>Đặc biệt những Khách hàng mua trong đợt này sẽ được tặng<strong> 5 chỉ vàng SJC + Chiết khấu 5% + Sổ Tiết Kiệm 20 triệu</strong><br />- Phương thức thanh toán ưu việt theo tiến độ. Khách hàng chỉ cần trả trước 490 triệu đồng là sở hữu ngay một nền đất. Số tiền còn lại được Ngân hàng hỗ trợ cho vay từ 50% nên không chỉ giảm áp lực tài chính, mà còn giúp khách hàng sử dụng vốn đầu tư hiệu quả.</p>\n<p>- Trong bối cảnh hiện nay, việc đầu tư vào những dự án bất động sản An Hạ Garden không chỉ an toàn mà còn nhanh chóng mang lại lợi nhuận, nhất là khi Quốc hội vừa đưa ra chủ trương thúc đẩy nhanh tiến độ xây dựng tuyến đường Vành đai 3.</p>\n<table border=\"1\" cellspacing=\"1\" cellpadding=\"1\">\n<tbody>\n<tr>\n<td>ĐỢT TT</td>\n<td>THỜI ĐIỂM THANH TOÁN</td>\n<td>PTTT 35%</td>\n</tr>\n<tr>\n<td> </td>\n<td>Ngay khi ký phiếu cọc</td>\n<td>100.000.000 đồng</td>\n</tr>\n<tr>\n<td>ĐỢT 1</td>\n<td>\n<p>Ký HĐNT (Trong vòng 7 ngày kể từ ngày ký phiếu cọc)</p>\n</td>\n<td>35% giá trị sản phẩm (bao gồm tiền đặt cọc)</td>\n</tr>\n<tr>\n<td>ĐỢT 2</td>\n<td>\n<p>Trong vòng 45 ngày kể từ ngày thanh toán đợt 1</p>\n</td>\n<td>20% giá trị sản phẩm</td>\n</tr>\n<tr>\n<td>ĐỢT 3</td>\n<td>\n<p>Trong vòng 105 ngày kể từ ngày thanh toán đợt 1</p>\n</td>\n<td>15% giá trị sản phẩm</td>\n</tr>\n<tr>\n<td>ĐỢT 4</td>\n<td>Trong vòng 165 ngày kể từ ngày thanh toán đợt 1</td>\n<td>15% giá trị sản phẩm</td>\n</tr>\n<tr>\n<td>ĐỢT 5</td>\n<td>Trong vòng 225 ngày kể từ ngày thanh toán đợt 1</td>\n<td>10% giá trị sản phẩm</td>\n</tr>\n<tr>\n<td>ĐỢT 6</td>\n<td>Ngay sau khi bàn giao Giấy Chứng Nhận Quyền Sử Dụng Đất</td>\n<td>5% giá trị sản phẩm</td>\n</tr>\n</tbody>\n</table>\n<p>Đặc biệt những Khách hàng mua trong đợt này sẽ được tặng<strong> 5 chỉ vàng SJC + Chiết khấu 5%+ 1 Sổ Tiết Kiệm 20 triệu</strong></p>\n\n[/col]\n\n[/row]\n\n[/section]\n[section label=\"Tiến độ\" padding=\"37px\" class=\"tien-do\"]\n\n[row]\n\n[col span__sm=\"12\"]\n\n[title style=\"center\" text=\"Tiến độ dự án An Hạ Gargen\" tag_name=\"h2\" color=\"rgb(170, 0, 0)\"]\n\n\n[/col]\n[col span=\"6\" span__sm=\"12\"]\n\n<ul id=\"tien-do\">\n<li class=\"bullet-checkmark bullet-star\"><strong><span style=\"color: #bd0000;\">1. </span></strong>Dự án AN HẠ GARDEN quy mô 1 ha,vị trí đắc địa khu vực phía Tây Sài Gòn “Trái tim của các nhà đầu tư”. </li>\n<li class=\"bullet-checkmark bullet-star\"><span style=\"color: #bd0000;\"><strong>2.</strong> </span>Đây là dự án đất nền tại Bình Chánh, TP HCM nhưng giá bán cực kỳ ưu đãi chỉ 14triệu/m2, đây là mức giá rất hiếm trên thị trường</li>\n<li class=\"bullet-checkmark bullet-star\"><span style=\"color: #bd0000;\"><strong>3.</strong></span> Dự án AN HẠ GARDEN được thiết kế rất hiện đại nhưng cũng gần gũi với thiên nhiên, 2 mặt giáp sông cực kì thoáng mát. Rất thích hợp cho hộ gia đình về an cư, nghỉ dưỡng.</li>\n<li class=\"bullet-checkmark bullet-star\"><span style=\"color: #bd0000;\"><strong>4. </strong></span>Liền kề các cụm khu công nghiệp lớn như KCN AN HẠ, KCN LÊ MINH XUÂN, KCN TÂN ĐÔ, TÂN ĐỨC.....Đường tỉnh lộ 10 kết nối giao thông giao thương giữa các tỉnh thành miền tây một cách nhanh chóng.</li>\n<li class=\"bullet-checkmark bullet-star\"><strong><span style=\"color: #bd0000;\">5.</span> </strong>Bệnh viện Chợ Rẫy 2 và bệnh viện Nhi Đồng 3 đã được khởi công xây dựng. Bộ y tế quyết định đưa 2 bệnh viện lớn về phía khu vực giãn dân để giảm tải cho các khu vực trung tâm thành phố cũng như là phục vụ nhu cầu của người dân khu vực ngoại thành tốt hơn.</li>\n</ul>\n\n[/col]\n[col span=\"6\" span__sm=\"12\"]\n\n[ux_image id=\"260\" image_size=\"original\"]\n\n\n[/col]\n\n[/row]\n\n[/section]\n[section label=\"Hình ảnh\" bg_color=\"rgb(246, 246, 246)\" padding=\"42px\" class=\"tin-tuc-section\"]\n\n[row style=\"small\"]\n\n[col span__sm=\"12\"]\n\n[title style=\"center\" text=\"Hình ảnh dự án\" tag_name=\"h2\" color=\"rgb(211, 0, 0)\"]\n\n<p id=\"hinh-anh\" style=\"text-align: center;\">Mời bạn cùng xem một số hình ảnh về dự án cũng như tiến độ thực hiện dự án trong thời gian tới</p>\n[ux_gallery ids=\"344,345,346,347,348,349,350,309,248\" style=\"normal\" col_spacing=\"xsmall\" columns=\"3\" image_height=\"70%\" image_size=\"original\" image_overlay=\"rgba(255, 255, 255, 0.37)\" image_hover=\"overlay-add\" image_hover_alt=\"null\" text_align=\"center\" class=\"list-hinh-anh\"]\n\n\n[/col]\n\n[/row]\n\n[/section]\n[section label=\"Liên hệ\" bg_color=\"rgb(22, 22, 22)\" dark=\"true\" padding=\"39px\" c